import React, { useState, useEffect } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import mapStyle from '../../maps/mapStyle.json';
import axios from 'axios';
import NavBar from '../../components/NavBar';



const MapContainer = (props) => {
    const [markers, setMarkers] = useState([])
    useEffect(() => {
        axios.get('https://iron-cors-anywhere.herokuapp.com/https://maps.googleapis.com/maps/api/place/nearbysearch/json?location=32.78711711056142,-96.78982852480252&radius=1500&type=restaurant&key=AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M')
            .then((response) => {
                //setLocations(response.data.results);
                setMarkers(response.data.results.map(place => {
                    let icon = {
                      url: place.icon,
                      size: new props.google.maps.Size(71, 71),
                      origin: new props.google.maps.Point(0, 0),
                      anchor: new props.google.maps.Point(17, 34),
                      scaledSize: new props.google.maps.Size(25, 25)
                    };

                    return <Marker className="marker" key={place.place_id} title={place.name} style={mapStyle} icon={icon} name={place.name} position={place.geometry.location} onClick={()=>props.history.push(`/each-place-d/${place.place_id}`)} />
                  }))
            })
    }, []);

    return (
        <div>
        <NavBar/>
        <Map
            className='Map'
            google={props.google}
            zoom={14.5}
            draggableCursor='default'
            styles={mapStyle}
            disableDefaultUI={true}
            zoomControl={false}
            scaleControl={false}
            rotateControl={false}
            gestureHandling="none"
            initialCenter={
                {
                    //32.78711711056142, -96.78982852480252
                    lat: 32.78711711056142,
                    lng: -96.80682852480252
                }
            }
        >
            {markers}

        </Map>
        </div>
    );

}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M',
})(MapContainer);
